import React, { Component } from 'react'
import Contact from '../contact/Contact'
class Contacts extends Component {
    state = {
        contact : [
            { id: 1, name: 'mohammed bjj', tel:'0222645654', email: 'med@kke.com'},
            { id: 2, name: 'mohammed sss', tel:'02225445654', email: 'meddd@kke.com'},
            { id: 3, name: 'mohammed ddd', tel:'0222665654', email: 'mezzzd@kke.com'}
        ]
    }
    render() {
        const { contact } = this.state;
        return (
            <div>
                {contact.map( contact => {
                    <Contacts 
                        name = { contact.name } 
                        tel = { contact.tel }
                        email = { contact.email }
                    />
                })}
            </div>
        )
    }
}


export default Contacts;
